import React, { Component } from 'react';
import { NavDropdown ,Button } from 'react-bootstrap';


export class DropDown extends Component {

  state = {
    address: '0x7F40EB094ACa301A3D7B20193ec9F89FF68F255E'

}



constructor(props) {
    super(props);

    
    this.onSubmitRenderStudents = this.onSubmitRenderStudents.bind(this);
   
}

render () {
    return (
        
        <NavDropdown title="Functions" id="basic-nav-dropdown" className ="text-white text-uppercase ml-5">
            <NavDropdown.Item> 
            <Button variant="light" 
                    onClick={this.onSubmitRenderStudents}
                    >Renders Students
                </Button>
            </NavDropdown.Item>
            <NavDropdown.Item>Another action</NavDropdown.Item>
            <NavDropdown.Item>Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>
       
    );
}

    onSubmitRenderStudents(event) {
        event.preventDefault();
        this.props.history.push(`/RenderStudents/${this.state.address}`)
    }
}

export default DropDown;
